import { 
  Card, 
  CardContent, 
  CardMedia, 
  Typography, 
  Box, 
  IconButton 
} from '@mui/material';
import {
  LinkedIn,
  GitHub,
  Email
} from '@mui/icons-material';

function TeamMemberCard({ member }) {
  return (
    <Card 
      sx={{ 
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
        transition: 'transform 0.2s',
        '&:hover': {
          transform: 'translateY(-8px)',
          boxShadow: 6
        }
      }}
    >
      <CardMedia
        component="img"
        height="280"
        image={member.image}
        alt={member.name}
        sx={{ objectFit: 'cover' }}
      />
      <CardContent sx={{ flexGrow: 1 }}>
        <Typography variant="h6" gutterBottom>
          {member.name}
        </Typography>
        <Typography 
          variant="subtitle1" 
          color="primary" 
          gutterBottom
        >
          {member.role}
        </Typography>
        <Typography 
          variant="body2" 
          color="text.secondary"
          paragraph
        >
          {member.description}
        </Typography>
        <Box sx={{ mt: 2 }}>
          {member.linkedin && (
            <IconButton 
              href={member.linkedin} 
              target="_blank"
              color="primary"
              size="small"
              sx={{ mr: 1 }}
            >
              <LinkedIn />
            </IconButton>
          )}
          {member.github && (
            <IconButton 
              href={member.github} 
              target="_blank"
              color="primary"
              size="small"
              sx={{ mr: 1 }}
            >
              <GitHub />
            </IconButton>
          )}
          {member.email && (
            <IconButton 
              href={`mailto:${member.email}`}
              color="primary"
              size="small"
            >
              <Email />
            </IconButton>
          )}
        </Box>
      </CardContent>
    </Card>
  );
}

export default TeamMemberCard;
